pragma solidity ^0.5.13;

contract SimpleWallet {
    
    address owner;

    constructor() public {
        owner  = msg.sender;
    }

    
     function withdrawMoney(address payable _to, uint _amount) public {
         require(msg.sender == owner,"You cannot withdraw as you are not the owner");
         _to.transfer(_amount);
     }

